import React,{useState} from "react";

import ExpenseItem from "./components/Expenses/ExpenseItem";
import './Expenses.css'

const Expenses =(props) => {
    {props.data.map((ele) => {
        return (
          <ExpenseItem id={ele.id}
            key={ele.id}
            title={ele.title}
            date={ele.date}
            amount={ele.amount}
          />
        );
      })}
}

export default Expenses;
